import React, { useEffect, useState } from "react";
import './sidebar.css'
import axios from "axios";
import { TbBrandGoogleHome } from "react-icons/tb";
import { TbLayoutDashboard } from "react-icons/tb";
import { FaRegCircleUser } from "react-icons/fa6";
import { LuBookmark } from "react-icons/lu";
import { FaComments } from "react-icons/fa6";
import { useNavigate } from "react-router-dom";


function Sidebar() {
    const navigate = useNavigate();
    const [categories, setCategories] = useState({});

    useEffect(() => {
        axios.get("http://localhost:8080/api/categories")
        .then(response => {
            setCategories(response.data);
        })
        .catch(error => {
            console.error("There was an error fetching the categories!", error);
        })
    }, []);

    return ( 
        <div className="sidebar">
            <div className="sidebarWrapper">

                <div className="sidebarBrend">
                    <h1>Wellty</h1>
                </div>

                <div className="sidebarMenu">
                    <h3 className="sidebarTitle">Dashboard</h3>
                    <ul>
                        <li onClick={() => navigate("/")}>
                            <TbBrandGoogleHome className="sidebarIcon" />
                            Home
                        </li>
                        <li onClick={() => navigate("/dashboard")}>
                            <LuLayoutDashboard className="sidebarIcon" />
                            Dashboard
                        </li>
                        <li onClick={() => navigate("/users")}>
                            <FaRegCircleUser className="sidebarIcon" />
                            Users
                        </li>
                        <li onClick={() => navigate("/reports")}>
                            <LuBookmark className="sidebarIcon" />
                            Reports
                        </li>
                        <li onClick={() => navigate("/community")}>
                            <FaComments className="sidebarIcon" />
                            Community
                        </li>
                    </ul>
                </div>
            </div>
        </div>
    )
}

export default Sidebar;
